import {
    CopilotIcon,
    GitPullRequestIcon,
    InboxIcon,
    MarkGithubIcon,
    ThreeBarsIcon,
} from '@primer/octicons-react'
import { Avatar, Box, Heading, IconButton } from '@primer/react'

export function Navigation() {
    const src = 'https://avatars.githubusercontent.com/u/13389614?v=4'
    const style = {
        color: 'fg.muted',
    }

    return (
        <Box
            sx={{
                display: 'flex',
                bg: 'canvas.subtle',
                borderBottom: '1px solid',
                borderColor: 'border.default',
                gap: '3',
                alignItems: 'center',
                p: 3,
            }}
        >
            <Box>
                <IconButton
                    sx={style}
                    icon={ThreeBarsIcon}
                    aria-label="Open menu"
                />
                <MarkGithubIcon size={32} />
                <Heading
                    sx={{
                        fontSize: '1rem',
                    }}
                >
                    Avocado Corp.
                </Heading>
            </Box>
            <Box
                sx={{
                    display: 'flex',
                    gap: '2',
                    alignItems: 'center',
                }}
            >
                <IconButton
                    sx={style}
                    icon={GitPullRequestIcon}
                    aria-label="Open pull requests"
                />
                <IconButton
                    sx={style}
                    icon={InboxIcon}
                    aria-label="Open inbox"
                />
                <IconButton
                    sx={style}
                    icon={CopilotIcon}
                    aria-label="Open Copilot"
                />
                <Avatar size={32} src={src} />
            </Box>
        </Box>
    )
}
